{
    protected $signature = 'index:params';
    protected $description = 'Update params algolia index';
    private $index;

    public function __construct()
    {
        parent::__construct();

        $client = SearchClient::create();
        $this->index = $client->initIndex('metaparams');

    }

    public function handle()
    {
        $this->index->replaceAllObjects($this->getObjects(), ['safe' => true]);
        $this->applySettings();
    }

    private function getObjects()
