        {
            $object['objectID'] = $name;
            $object['name'] = $name;
            $object['label'] = $name;
            $object['camel_case_label'] = $object['name'];
            $object['type'] = 'param';
            $object['ranking'] = 2;
            $object['admin_only'] = $object['admin_only'] ?? 0;

            $objects[] = $object;

