            {
                foreach ($object['values'] as $value)
                {
                    $name = is_array($value) ? $value['name'] : $value;
                    $label = is_array($value) ? "{$name} ({$value['label']})" : $name;
                    $label = "{$object['name']}: {$label}";

                    $objects[] = [
                        'objectID' => "{$object['name']}_{$name}",
                        'name' => $name,
                        'display_name' => $name,
                        'label' => $label,
                        'camel_case_label' => $label,
                        'param_name' => $object['name'],
                        'scope' => $object['scope'],
                        'type' => 'value',
                        'value_type' => $object['value_type'],
                        'ranking' => 1
                    ];
                }

            }
        }

